const data = [
  { id: 1, name: "Macbook", price: 50 },
  { id: 2, name: "Lenovo", price: 40 },
  { id: 3, name: "ACER", price: 60 },
  { id: 4, name: "HP", price: 30 },
  { id: 5, name: "DELL", price: 80 },
];

export default data;
